shaders.vert:
#define _IS_VERT_SHADER 1

precision highp float;

uniform mat4 cc_matViewProj;
attribute vec3 a_position;
attribute mediump vec2 a_uv0;
varying mediump vec2 v_uv0;
varying mediump vec3 v_pos;

void main () {
  gl_Position = cc_matViewProj * vec4(a_position, 1);
  v_uv0 = a_uv0;
  v_pos = a_position;
}

shaders.frag:
#define _IS_FRAG_SHADER 1

precision highp float;

uniform sampler2D texture;
uniform sampler2D texture1;
varying mediump vec2 v_uv0;
varying mediump vec3 v_pos;

void main()
{
    vec4 tex = texture2D(texture,v_uv0);
    float x = mod(v_pos.x*0.5,250.0)/250.0;
    float y = mod(v_pos.y*0.5,350.0)/350.0;
    vec4 tex1 = texture2D(texture1,vec2(x,y));
    if (tex.a == 0.0) {
      gl_FragColor = tex*0.0;
    } else {
      gl_FragColor = tex1 * tex1.a + tex * (1.0 - tex1.a);
      gl_FragColor.a = tex.a;
    }
}
